import imgHeader from './images/plane.jpg';

import imgMoscow from './images/moscow.jpg';
import imgHonduras from './images/honduras.jpg';
import imgPuertoRico from './images/puerto-rico.jpg';

import imgFacebook from './images/facebook.svg';
import imgInstagram from './images/instagram.svg';
import imgTwitter from './images/twitter.svg';


// import IcoFigma from './img/figma.svg';
// import IcoGitHub from './img/github.svg';
// import IcoApi from './img/api.svg';
// import IcoLinkedin from './img/linkedin.svg';

const images = [
    {
        name: "imgHeader",
        url: imgHeader,
        title: "Plane travel"
    },
    {
        name: "imgMoscow",
        url: imgMoscow,
        title: "Moscow"
    },
    {
        name: "imgHonduras",
        url: imgHonduras,
        title: "Honduras"
    },
    {
        name: "imgPuertoRico",
        url: imgPuertoRico,
        title: "Puerto Rico"
    },
    {
        name: "imgFacebook",
        url: imgFacebook,
        title: "follow me in facebook"
    },
    {
        name: "imgInstagram",
        url: imgInstagram,
        title: "follow me in instagram"
    },
    {
        name: "imgTwitter",
        url: imgTwitter,
        title: "follow me in twitter"
    }
];

export default images;
